import React from 'react';

const Todo = () => {
    return(
        <div className='todo'>
            <li className='todo-item'>heeyyy</li>
            <button className='fas fa-check'><i></i></button>
            <button className='fas fa-trash'><i></i></button>
        </div>
    );
}

export default Todo;
